import React from "react";
import "./Jumbotron.css";

function Jumbotron({ props, children }) {
  return (
    <div
      style={{ height: 300, 
                clear: "both", 
                paddingTop: 120, 
                textAlign: "center",
                backgroundImage: "url("+props.backgroundImage+")"
              }}
      className="jumbotron"
    >
      {children}
    </div>
  );
}

export default Jumbotron;
